import IMAHeader from './IMAHeader';
import React from 'react';
import globalStyles from '../styles/global.js'


const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const IMALayout = props => (
  <div className="page-layout">
    {props.children}
    <style jsx global>
      {globalStyles}
    </style>
    <IMAHeader />
  </div>

);
export default IMALayout;
